webpackJsonp([57773273933868],{492:function(t,e){t.exports={data:{markdownRemark:{html:"<p>In this country house we initially worked on the impressive entrance hall, stairs, and landing.</p>\n<p>To elevate the entrance we designed a bespoke marble flooring pattern with borders and cabochons in a contrasting colour, which we laid over wet underfloor heating for a luxury feel. Our Joiner crafted Georgian-inspired half panelling and bespoke window seats, and we completed the interior with calming lighting and a stunning damask wallpaper up the stairs and landing.</p>\n<p>We recently returned to the property to renovate the master suite and guest bedrooms, continuing with a neutral palette to emphasise the abundant natural light throughout the house.</p>",frontmatter:{date:"January 01, 2021",slug:"2021-country-mansion",title:"Country Mansion in Surrey",cover:"moreton-cover.jpg"}},galleriesJson:{images:[{title:null,path:"moreton01.jpg"},{title:null,path:"moreton02.jpg"},{title:null,path:"moreton03.jpg"},{title:null,path:"moreton04.jpg"},{title:null,path:"moreton06.jpg"},{title:null,path:"moreton07.jpg"},{title:null,path:"moreton08.jpg"},{title:null,path:"moreton09.jpg"},{title:null,path:"moreton10.jpg"},{title:null,path:"moreton11.jpg"},{title:null,path:"moreton12.jpg"},{title:null,path:"moreton13.jpg"},{title:null,path:"moreton14.jpg"},{title:null,path:"moreton15.jpg"}]}},pathContext:{slug:"2021-country-mansion"}}}});
